import React, { Component } from 'react';
import './AddProduct.css';


class AddProduct extends Component {

handlDefault = (e) => {
    e.preventDefault();
}

    render() { 
        return (     
            <div className="AddProduct">
            <form onSubmit={this.handlDefault}>
            <div className="item1">
            <input className="btn btn-secondary" type="text" placeholder="Name Of Product" />
            <button className="btn btn-danger">Name Of Product</button>
            </div>
            <div className="item2">
            <select className="btn btn-secondary">
            <option value="phone">Phone</option>
            <option value="laptop">Laptop</option>
            <option value="screen">Sceeen</option>
            </select>
            <button className="btn btn-danger">Select a Product</button>
            </div>
            <div className="item3">
            <textarea className="btn btn-secondary" type="text" cols="60" rows="10" placeholder="Details Of Product"></textarea>
            <button className="btn btn-danger">Details Of P</button>
            </div>  
            <div className="item4">
            <input type="file" name="pic" accept="image/*" />
            <input type="submit" />
            </div>
            <div className="item5">

            <input type="text" placeholder="Place" />
            </div>
            </form>          
            </div>

        );
    }
}

export default AddProduct;
